INSERT INTO `motorcycle_terms` VALUES (1,'R차(레플리카)','경주용 바이크를 복제한 형태로 공도 주행이 가능하도록 제작된 스포츠 바이크','장르','kknd03255','2024-12-28 23:32:31','kknd03255','2024-12-29 00:05:53','ACTIVE'),(2,'풀페이스','머리 전체와 턱을 보호하며 실드를 통해 눈과 코까지 전체를 보호해주는 헬멧','헬멧','kknd03255','2024-12-28 23:36:00',NULL,NULL,'ACTIVE'),(3,'오픈페이스','얼굴과 턱이 개방된 헬멧으로, 착용이 쉽고 가볍다는 장점으로 시내를 돌아다닐 때 유용하다. 장거리 투어시에는 풀페이스를 쓰는것을 추천','헬멧','kknd03255','2024-12-28 23:39:11',NULL,NULL,'ACTIVE'),(4,'시스템 헬멧','풀페이스와 오픈페이스의 하이브리드. 풀페이스의 안전성과 오픈페이스의 편리함을 적당하게 조율한 헬멧이다. 단점은 무게가 무겁다. 장시간 사용시 목이 아프다, 비율이 텔레토비가 된다','헬멧','kknd03255','2024-12-28 23:41:46',NULL,NULL,'ACTIVE'),(5,'하프페이스','윗머리만 보호해주고, 귀와 눈부터 턱까지 보호해주지 않는다. 할리나 크루저 계열, 혹은 슈퍼커브를 타는 사람들이 자주 사용하나, 편한 만큼 사고시 보호능력은 0에 수렴한다.','헬멧','kknd03255','2024-12-28 23:45:01',NULL,NULL,'ACTIVE'),(6,'오프로드 헬멧','상단에 선바이저가 있고, 활동량이 많은 만큼 호흡이 편하게 돌출되어 있다. 다른 플페이스처럼 실드가 없고 고글을 장착하여 사용한다.','헬멧','kknd03255','2024-12-28 23:46:14',NULL,NULL,'ACTIVE'),(7,'크루저','편안한 라이딩 포지션과 낮은 시트고를 가진 장거리 주행용 바이크','장르','kknd03255','2024-12-29 00:06:26',NULL,NULL,'ACTIVE'),(8,'투어러','장거리 주행에 최적화된 대형 바이크','장르','kknd03255','2024-12-29 00:06:47',NULL,NULL,'ACTIVE'),(9,'어드벤처','온로드와 오프로드를 모두 주행할 수 있는 다목적 바이크','장르','kknd03255','2024-12-29 00:07:09',NULL,NULL,'ACTIVE'),(10,'멀티퍼포즈 / 듀얼퍼포즈','어드벤처와 비슷하게 온로드 오프로드를 주행 가능하지만 어드벤처보다 가벼운 차체와 단순한 구조가 특징','장르','kknd03255','2024-12-29 00:08:18',NULL,NULL,'ACTIVE'),(11,'네이키드','카울이 없는 바이크. 엔진이 노출되어 있고, 편안한 라이딩이 특징','장르','kknd03255','2024-12-29 00:08:55',NULL,NULL,'ACTIVE'),(12,'스크램블러','클래식 바이크에 오프로드 성능을 추가한 모델. 머플러가 대게 높게 위치해 있는 것이 특징이다','장르','kknd03255','2024-12-29 00:09:32',NULL,NULL,'ACTIVE'),(13,'오프로드','비포장도로나 험로에서의 주행을 목적으로 설계된 바이크. 바퀴가 크고, 서스펜션이 길며, 무게가 가볍다','장르','kknd03255','2024-12-29 00:10:13',NULL,NULL,'ACTIVE'),(14,'모타드','오프로드 바이크에 온로드 타이어를 장착해 도로주행에 적합하게 만든 모델. 높은 시트고와 핸들이 가벼운게 특징','장르','kknd03255','2024-12-29 00:10:44',NULL,NULL,'ACTIVE'),(15,'스쿠터','자동 변속기를 채택한 오토바이. ','장르','kknd03255','2024-12-29 00:11:08',NULL,NULL,'ACTIVE'),(16,'클래식','복고풍 디자인과 전통적인 구조를 가진 바이크','장르','kknd03255','2024-12-29 00:11:30',NULL,NULL,'ACTIVE'),(17,'카페레이서','클래식한 디자인에 낮은 핸들바와 공격적인 라이딩 포지션, 그리고 경량화된 차체가 특징. 짧은 거리의 빠른 주행과 레트로 감성이 중요하다.','장르','kknd03255','2024-12-29 00:12:15',NULL,NULL,'ACTIVE'),(18,'바리','라이딩을 하면서 돌아다니는 것.\n바리를 순우리말로 하면 무리라는 뜻도 있어서 여러명이서 라이딩을 하며 돌아다닌다는 뜻으로도 활용됨','주행용어','GUEST','2024-12-30 10:25:12',NULL,NULL,'ACTIVE'),(19,'츄300R','CB300R을 한글로 작성하면 츄300R이 된다.<br>CB300R = 츄300R','모델','GUEST','2024-12-30 10:57:58',NULL,NULL,'ACTIVE'),(20,'몰바','들키지 않으면 문제도 아니다. 몰바의 기본 철학이다.<br>몰라 바이크를 탄다는 뜻이다','주행용어','GUEST','2024-12-30 11:02:17','kknd03255','2024-12-30 11:08:56','ACTIVE'),(21,'애기부리','브이스트롬 시리즈에서 가장 작은 배기량을 담당하는 브이스트롬250<br>멀티퍼포즈의 부리를 하고 있지만, 가장 작은 배기량으로 인해 애기부리라는 별명을 갖게 되었다','모델','GUEST','2024-12-30 11:11:30','kknd03255','2024-12-30 11:11:38','ACTIVE'),(22,'바접','바이크를 접는다는 뜻. ','주행용어','anonymousUser','2025-01-16 02:02:50','kknd03255','2025-01-18 12:10:02','ACTIVE'),(23,'기변(병)','바이크를 판매하고 새로운 바이크로 바꾸는 행위. 기변병이란, 하나의 바이크에 정착해서 오래 타는것이 아닌 잠깐 타고 다른 바이크를 사서 또 잠깐 타는 병','기타','kknd03255','2025-01-18 12:09:27','kknd03255','2025-01-18 12:00:00','ACTIVE'),(24,'탑박스','오토바이 뒤에 장착하는 수납공간. 오토바이의 모델과, 탑바스의 디자인에 따라 이미지나 분위기가 달라진다','부품, 장비','kknd03255','2025-01-18 22:11:35','kknd03255','2025-01-18 22:11:50','ACTIVE'),(25,'요시무라','중저음이 깊고 묵직하며, 고회전에서는 날카로운 사운드로 변화. 일본 전통의 정통 배기음으로 유명하며 특히 스즈키 바이크와 궁합이 좋다.','부품, 장비','kknd03255','2025-01-19 04:41:43','kknd03255','2025-01-19 04:44:10','ACTIVE'),(26,'모리와키 엔지니어링','저음부터 중음까지 고르게 분포된 안정적인 배기음이 특징. 일상적인 주행에서도 부담스럽지 않은 소리를 생성.','부품, 장비','kknd03255','2025-01-19 04:42:17','kknd03255','2025-01-19 04:44:16','ACTIVE'),(27,'빔스','중저음이 풍부하고 날카로운 고음이 적절히 믹스된 독특한 사운드 제공. 혼다 바이크와의 조합이 대표적.','부품, 장비','kknd03255','2025-01-19 04:42:33','kknd03255','2025-01-19 04:44:14','ACTIVE'),(28,'아크라포빅','저음과 중음이 조화로운 깊이 있는 배기음 특징. 고회전에서도 귀에 피로감이 적음.','부품, 장비','kknd03255','2025-01-19 04:42:46','kknd03255','2025-01-19 04:44:13','ACTIVE'),(29,'SC 프로젝트','스포티한 고음역대의 날카로운 사운드가 특징. MotoGP 레이싱 팀들이 선호.','부품, 장비','kknd03255','2025-01-19 04:42:58','kknd03255','2025-01-19 04:44:17','ACTIVE'),(30,'애로우','중저음이 풍부하면서도 스포티한 고음이 적절히 섞인 균형잡힌 사운드. 유럽 바이크 적합.','부품, 장비','kknd03255','2025-01-19 04:43:11','kknd03255','2025-01-19 04:44:12','ACTIVE'),(31,'떼르미뇨니','중후한 저음과 날카로운 고음이 조화를 이루는 이탈리아식 배기음. 두카티 특화.','부품, 장비','kknd03255','2025-01-19 04:43:27','kknd03255','2025-01-19 04:44:16','ACTIVE'),(32,'반스 앤 하인즈','미국 크루저 바이크에 최적화된 깊고 풍부한 저음 특징. 하이웨이 크루징에 적합.','부품, 장비','kknd03255','2025-01-19 04:43:42','kknd03255','2025-01-19 04:44:15','ACTIVE'),(33,'스크리밍 이글','미국식 하이퍼포먼스 사운드 추구. 할리 데이비슨 공식 퍼포먼스 파츠 브랜드.','부품, 장비','kknd03255','2025-01-19 04:43:56','kknd03255','2025-01-19 04:44:14','ACTIVE');
